import React, { Component, Fragment } from "react";
import ReactDOM from "react-dom";
import Header from "./component/header";
import Main from "./component/main";
import logo from '.src/component/logolucre.svg'; // Tell webpack this JS file uses this image

import "./styles.css";

class Place extends Component {
  render() {
    return (
      <Fragment>
        <div className="logoCont row">
        <img src={logo} alt="Logo" width="350" height="350" />;
          <div className="logo">
          </div>
        </div>

        <Header />
        <h1>Ensaladas</h1>
        <Main />
      </Fragment>
    );
  }
}

ReactDOM.render(<Place />, document.getElementById("root"));
